	(function() {
		// 창작물 검색 팝업 탭
		$('ul.tab li').click(function() {
			var activeInnerTabFunc = function(that) {
				var activeTabId = $(that).attr('data-tab');
				
				$("ul.inner_tab").removeClass("current");
				$(that).parents("ul").eq(0).addClass("current");
				
				$('ul.inner_tab li').removeClass('current');
				$(that).addClass('current');
				
				$('.tabcontent').removeClass('current');
				$('#' + activeTabId).addClass('current');
			};
			
			if($(this).parents("ul").eq(0).hasClass("outer_tab")) {
				if($(this).attr("id") === outerTabTypeId) {
					return ;
				}
				
				var tabTypeId = $(this).attr("data-type");
				
				$('ul.outer_tab li').removeClass('current');
				$(this).addClass('current');
				
				activeInnerTabFunc($("#" + tabTypeId).find("li").eq(0));
				
				outerTabTypeId = $(this).attr("id");
			} else {
				activeInnerTabFunc(this);
			}
		});
		
		$('#pop_identifier_type').change(function() {
			if($(this).val() === "") {
				$("#pop_identifier_id").attr("placeholder", "");
			} else if($(this).val() === "DOI") {
				$("#pop_identifier_id").attr("placeholder", "예시) 10.979.116365/0669");
			} else if($(this).val() === "ISBN") {
				$("#pop_identifier_id").attr("placeholder", "예시) 9788936433673");
			} else if($(this).val() === "ISSN") {
