	function AddResource(){
		if($('input[type="checkbox"][name="chk_resource"]:checked').length > 0){
			var addResouceLength = $('input[type="checkbox"][name="chk_resource"]:checked').length;
			var controlNoListLength = 0;
			
			if($("#resourceSearchPopType").val() !== "1") {
				if($("#control_no_list").val()) {
					controlNoListLength = $("#control_no_list").val().split(";").length;
				} else {
					controlNoListLength = 0;
				}
				
				//	2020/03/27 pbs - 수정요청 시에도 창작물을 여러 건 추가할 수 있도록 기능 개선(송민상 선생님 요청사항)
				if(addResouceLength + controlNoListLength > 5) {
					alert('창작물은 최대 5개까지 추가할 수 있습니다.');
					return false;
				}
// 				if(addResouceLength > 1) {
// 					alert("창작물은 1건만 선택 가능합니다.");
// 					return false;
// 				}
			}
			
			var no = 0;
			
			var checkbox = $("input[type='checkbox'][name=chk_resource]:checked");
			
			//	*- 추가할 창작물 개수에 맞게 창작물 입력상자 처리.
			var cls = "add_res";
			if($("#resourceSearchPopType").val() !== "1") {
				var leng = 0;
				
				if(addResouceLength + controlNoListLength > $(".add_res").length) {
					leng = addResouceLength + controlNoListLength - $(".add_res").length;
					
					var addRow = $(".add_res").eq(0);
					
					for(var i = 0; i < leng; i++) {
						addModifyRow(addRow, cls);
					}
				}
			}
			
			$(checkbox).each(function(i, elem) {
				var tr = $(elem).parents("tr").eq(0);
				
				var pop_control_no = $(elem).val();
// 				var pop_control_no = $('#resForm').find('input[type="checkbox"][name="chk_resource"]:checked').eq(i).val();
				var pop_title = tr.find('.res_title').text();
				var pop_publisher = tr.find('.res_publisher').text();
				var pop_publish_year = tr.find('.res_publish_year').text();
				var pop_identifier_type = tr.find('.res_identifier_type').text();
				var pop_identifier_id = tr.find('.res_identifier_id').text();
// 				var pop_publish_year = tr.find('input.res_publish_year').val();
				
				$('#control_no').val(pop_control_no);
				$('#title').val(pop_title);
				$('#publisher').val(pop_publisher);
				$('#publish_date').val(pop_publish_year);
				$('#identifier_id').val("");
				$('#identifier_type').val(pop_identifier_type);
				$('#identifier_id').val(pop_identifier_id);
				$('#nlk_resource_url').val("");
				
				if($("#resourceSearchPopType").val() === "1") {
					no += AddTableResource();
				} else {
					$(".add_res").eq(i + controlNoListLength).find("input[name=resource_title]").val(pop_title);
					
					var control_no_list = $("#control_no_list").val();
					var title_list 		= $("#title_list").val();
					
					if(control_no_list) {
						$("#control_no_list").val(control_no_list + ";" + $("#control_no").val());
					} else {
						$("#control_no_list").val($("#control_no").val());
					}
					if(title_list) {
						$("#title_list").val(title_list + ";" + $("#title").val());
					} else {
						$("#title_list").val($("#title").val());
					}
				}
			});
			
			if($("#resourceSearchPopType").val() === "1") {
				if(no > 0) {
					showAlertPop("창작물 추가", "선택한 창작물을 추가했습니다.");
				} else {
					showAlertPop("창작물 추가", "동일한 창작물은 추가할 수 없습니다.");
				}
			} else {
				//	X버튼 활성화
				$('.delete_img.resource_title').css('opacity', 0.5);
				$('.delete_img.resource_title').css('cursor', 'pointer');
				
				resourceTblReset();
			}
// 			if($("#resourceSearchPopType").val() === "1") {
// 				// 검색팝업 초기화
// 				$('#resForm tbody').empty();
// 				$('#resForm .res_paging').empty();
