	function AddTableResource(){
		var no = 0;
		
		var r_id = $('#r_id').val();
		var control_no = $('#control_no').val();
		var title = $('#title').val();
		var publisher = $('#publisher').val();
		var publish_date = $('#publish_date').val();
		var identifier_type = $('#identifier_type').val();
		var identifier_id = $('#identifier_id').val();
		var nlk_resource_url = $('#nlk_resource_url').val();

		if(title == null || title == ""){
			 alert('창작물의 제목이 누락되었습니다.');
	         return false;
		}
		
		var rownum = 0;
		if($("#addResource tr").length > 0){
			rownum = $("#addResource tr").last().attr('class').substr(9,10);
		}
		
		if(title != null && title != "" && title != "undefined"){
			var obj = {
				CONTROL_NO : control_no
				, R_ID : r_id
				, TITLE : title
				, PUBLISHER : publisher
				, PUBLISH_DATE : publish_date
				, IDENTIFIER_TYPE : identifier_type
				, IDENTIFIER_ID : identifier_id
				, NLK_RESOURCE_URL : nlk_resource_url
			};
			
			no = addResourceRow(obj, ++rownum, true);
			showAlertPop("창작물 등록", "창작물을 등록했습니다.");
// 			idx = idx+1;
		}else{
			alert("창작물 이름이 누락되었습니다.");
			no = 0;
		}
		
// 		$('.inputPop input[type=text]').val("");
// 		$('.close_btn').click();
		$('.default').hide();
		
		return no;
